import * as React from 'react';
import Button from '@mui/material/Button';
// import DeleteIcon from '@mui/icons-material/Delete';
// import SendIcon from '@mui/icons-material/Send';
// import Stack from '@mui/material/Stack';
// import swal from "sweetalert";
import { useDispatch, useSelector } from 'react-redux'
// import { addUser } from "./redux/Action";
// import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
// import {navigate} from /navigate";
// import { useNavigate } from "react-router-dom";
// import { SetUser } from "./redux/Action";
// import { useState } from "react";
import './style.css'

export const Login=()=>{ 
    return <>
        <section id="all">
            <div class="car-containers">
                <div class="car-roof"></div>
                <div class="car-body"><h2 id="h2">MilkisCars</h2></div>
                <div class="design-line"></div>
                <div class="window"></div>
                <div class="head-light"></div>
                <div class="fog-light"></div>
                <div class="door-knob"></div>
                <div class="tail-light"></div>
            </div>
            {/* <!-- Tire --> */}
            <div class="front-tires"></div>
            <div class="back-tires"></div>
        </section>
        <div className='login'>
            <h2 id="h4">הצטרפות</h2>
            <TextField id="outlined-basic" label=" הכנס קוד" variant="outlined"TextField/>
            <p className="error"> </p>

            <TextField id="outlined-basic" label=" הכנס שם" variant="outlined"  />
            <p className="error"></p>
            <TextField id="outlined-basic" label=" הכנס תעודת זהות" variant="outlined"/>
            <p className="error"></p>
            <TextField id="outlined-basic" label=" הכנס  טלפון" variant="outlined"/>
            <p className="error"></p>
            <TextField id="outlined-basic" label=" הכנס  סיסמה" variant="outlined"></TextField>
            <TextField id="outlined-basic" label=" הכנס  מס כרטיס" variant="outlined"/>
            <p className="error"></p>
            <TextField id="outlined-basic" label=" הכנס   תוקף" variant="outlined"/>
            <p> </p>
            <TextField id="outlined-basic" label=" cvv " variant="outlined"/>
            <p className="error"></p>
            <TextField id="outlined-basic" label=" סוג משתמש " variant="outlined"/>
            <p className="error"></p>
      
        <Button className='buto' onClick={send} variant="contained">
            שליחה
        </Button>
        </div>

    </>
}
